import React, { Component } from 'react'

export default class ListItem extends Component {
  render() {
    return (
      <div>
        <div className="todolist">
          <span>
            <h6>{this.props.doThis}</h6>
          </span>
          <span>
            <p>{this.props.deadline}</p>
          </span>
        </div>
      </div>
    )
  }
}
